import React, { useState } from 'react';
import {
  Box,
  Typography,
  IconButton,
  TextField,
  Button,
  InputAdornment
} from '@mui/material';
import CloseIcon from '@mui/icons-material/Close';
import Visibility from '@mui/icons-material/Visibility';
import VisibilityOff from '@mui/icons-material/VisibilityOff';

export default function RegistroCompletoModal({ onClose }) {
  const [formulario, setFormulario] = useState({
    nombre: '',
    apellido: '',
    correo: '',
    direccion: '',
    telefono: '',
    clave: '',
    confirmarClave: ''
  });
  const [mostrarClave, setMostrarClave] = useState(false);
  const [errores, setErrores] = useState({});

  const actualizarCampo = (campo, valor) => {
    setFormulario((prev) => ({ ...prev, [campo]: valor }));
  };

  const validar = () => {
    const err = {};
    if (!formulario.nombre) err.nombre = 'Nombre obligatorio';
    if (!formulario.apellido) err.apellido = 'Apellido obligatorio';
    if (!formulario.correo) err.correo = 'Correo obligatorio';
    if (!formulario.direccion) err.direccion = 'Dirección obligatoria';
    if (!formulario.telefono) err.telefono = 'Teléfono obligatorio';
    if (!formulario.clave) err.clave = 'Contraseña obligatoria';
    else if (formulario.clave.length < 6) err.clave = 'Mínimo 6 caracteres';
    if (formulario.clave !== formulario.confirmarClave) err.confirmarClave = 'No coincide';
    setErrores(err);
    return Object.keys(err).length === 0;
  };

  const handleRegistro = () => {
    if (!validar()) return;
    console.log('Registrando usuario:', formulario);
    onClose(); // Cerrar modal luego de registro
  };

  return (
    <Box
      sx={{
        position: 'fixed',
        top: 0,
        left: 0,
        width: '100vw',
        height: '100vh',
        bgcolor: 'rgba(0,0,0,0.5)',
        zIndex: 1200,
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center'
      }}
    >
      <Box
        sx={{
          position: 'relative',
          width: { xs: '95%', sm: 500 },
          bgcolor: 'white',
          borderRadius: 3,
          boxShadow: 6,
          px: 4,
          pt: 4,
          pb: 3
        }}
      >
        <IconButton onClick={onClose} sx={{ position: 'absolute', top: 12, right: 12 }}>
          <CloseIcon />
        </IconButton>

        <Typography variant="h6" sx={{ fontWeight: 'bold', color: '#2e7d32', mb: 3 }}>
          Registro de usuario
        </Typography>

        {/* Campos */}
        <TextField
          label="Nombre"
          fullWidth
          value={formulario.nombre}
          onChange={(e) => actualizarCampo('nombre', e.target.value)}
          error={!!errores.nombre}
          helperText={errores.nombre}
          sx={{ mb: 2 }}
        />
        <TextField
          label="Apellido"
          fullWidth
          value={formulario.apellido}
          onChange={(e) => actualizarCampo('apellido', e.target.value)}
          error={!!errores.apellido}
          helperText={errores.apellido}
          sx={{ mb: 2 }}
        />
        <TextField
          label="Correo electrónico"
          fullWidth
          value={formulario.correo}
          onChange={(e) => actualizarCampo('correo', e.target.value)}
          error={!!errores.correo}
          helperText={errores.correo}
          sx={{ mb: 2 }}
        />
        <TextField
          label="Dirección"
          fullWidth
          value={formulario.direccion}
          onChange={(e) => actualizarCampo('direccion', e.target.value)}
          error={!!errores.direccion}
          helperText={errores.direccion}
          sx={{ mb: 2 }}
        />
        <TextField
          label="Teléfono"
          fullWidth
          value={formulario.telefono}
          onChange={(e) => actualizarCampo('telefono', e.target.value)}
          error={!!errores.telefono}
          helperText={errores.telefono}
          sx={{ mb: 2 }}
        />
        <TextField
          label="Contraseña"
          fullWidth
          type={mostrarClave ? 'text' : 'password'}
          value={formulario.clave}
          onChange={(e) => actualizarCampo('clave', e.target.value)}
          error={!!errores.clave}
          helperText={errores.clave}
          InputProps={{
            endAdornment: (
              <InputAdornment position="end">
                <IconButton onClick={() => setMostrarClave(!mostrarClave)}>
                  {mostrarClave ? <VisibilityOff /> : <Visibility />}
                </IconButton>
              </InputAdornment>
            )
          }}
          sx={{ mb: 2 }}
        />
        <TextField
          label="Confirmar contraseña"
          fullWidth
          type="password"
          value={formulario.confirmarClave}
          onChange={(e) => actualizarCampo('confirmarClave', e.target.value)}
          error={!!errores.confirmarClave}
          helperText={errores.confirmarClave}
          sx={{ mb: 3 }}
        />

        {/* Botón registrar */}
        <Button
          fullWidth
          variant="contained"
          onClick={handleRegistro}
          sx={{
            bgcolor: '#fb8c00',
            color: 'white',
            fontWeight: 'bold',
            textTransform: 'none',
            py: 1.2,
            fontSize: '0.95rem',
            borderRadius: 2,
            '&:hover': { bgcolor: '#f57c00' }
          }}
        >
          Registrarme
        </Button>
      </Box>
    </Box>
  );
}
